import React, { useState, useRef } from "react";
import { useTranslation, initReactI18next } from "react-i18next";
import "../i18n";
import "./IntroPage.scss";

export const IntoPage = () => {
  const { t, i18n } = useTranslation();

  return (
    <div className="intro-page">
      <div className="intro-page-wrapper">
        <div className="psy-comfort-org">
          <div className="psy-comfort-org-header">
            {t("psy-comfort-org-header")}
          </div>
          <div className="psy-comfort-org-subheader">
            {t("psy-comfort-org-subheader")}
          </div>
        </div>
        <div className="statistics">
          <div className="team-engagement">
            <span className="team-engagement-text">{t("team-engagement")}</span>
            <div className="statistics-img-1"></div>
          </div>
          <div className="team-leader-engagement">
            <div className="statistics-img-2"></div>
            <span>{t("team-leader-engagement")}</span>
          </div>
        </div>
        <div className="block-3"></div>
      </div>
    </div>
  );
};
